import React from "react";
import "./Payment.css"


const Payment = () =>{

   document.addEventListener('DOMContentLoaded', function () {
  // Card Number Masking
  const cardNumberInput = document.getElementById('cardNumber');
  if (cardNumberInput) {
    cardNumberInput.addEventListener('input', function (e) {
      let value = e.target.value.replace(/\D/g, '');
      if (value.length > 16) value = value.slice(0, 16);
      let parts = value.match(/.{1,4}/g) || [];
      e.target.value = parts.join(' ');
    });
  }

  // Expiry Masking
  const expiryInput = document.getElementById('expiry');
  if (expiryInput) {
    expiryInput.addEventListener('input', function (e) {
      let value = e.target.value.replace(/\D/g, '');
      if (value.length > 4) value = value.slice(0, 4);
      if (value.length > 2) {
        value = value.slice(0, 2) + '/' + value.slice(2);
      }
      e.target.value = value;
    });
  }

  // You can do the same for other input fields like CVV, card holder, etc.
});

    
    return(
        <div><div className="text-center">
        <h2 className="text-3xl font-bold text-gray-900 mb-2">Payment Details</h2>
        <p className="text-gray-500">Complete your purchase securely</p>
    </div>

    <div className="relative h-48 bg-gradient-to-r from-indigo-500 to-purple-600 rounded-xl p-6 text-white float-animation">
        <div className="absolute top-4 right-4">
            <svg className="h-8" viewBox="0 0 48 48" fill="none">
                <path d="M45 35c0 2.209-1.791 4-4 4H7c-2.209 0-4-1.791-4-4V13c0-2.209 1.791-4 4-4h34c2.209 0 4 1.791 4 4v22z" fill="#ffffff"/>
            </svg>
        </div>
        <div className="mt-16">
            <div className="text-xl tracking-widest mb-2" id="cardNumberPreview">•••• •••• •••• ••••</div>
            <div className="flex justify-between">
                <div>
                    <div className="text-xs opacity-75">Card Holder</div>
                    <div className="text-sm" id="cardHolderPreview">YOUR NAME</div>
                </div>
                <div>
                    <div className="text-xs opacity-75">Expires</div>
                    <div className="text-sm" id="expiryPreview">MM/YY</div>
                </div>
            </div>
        </div>
    </div>

    <form className="mt-8 space-y-6">
        <div className="relative">
            <input type="text" id="cardHolder" className="card-input block w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none placeholder-transparent" placeholder="Card Holder Name" required
                oninput="document.getElementById('cardHolderPreview').textContent = this.value || 'YOUR NAME'"/>
            <label for="cardHolder" className="card-label absolute left-4 top-3 text-gray-500 transition-all duration-200">Card Holder Name</label>
        </div>

        <div className="relative">
            <input type="text" id="cardNumber" className="card-input block w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none placeholder-transparent" placeholder="Card Number" maxlength="19" required
                oninput="this.value = this.value.replace(/\W/gi, '').replace(/(.{4})/g, '$1 '); document.getElementById('cardNumberPreview').textContent = this.value || '•••• •••• •••• ••••'"/>
            <label for="cardNumber" className="card-label absolute left-4 top-3 text-gray-500 transition-all duration-200">Card Number</label>
        </div>

        <div className="grid grid-cols-2 gap-4">
            <div class="relative">
                <input type="text" id="expiry" className="card-input block w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none placeholder-transparent" placeholder="MM/YY" maxlength="5" required
                    oninput="this.value = this.value.replace(/\W/gi, '').replace(/(.{2})/g, '$1/'); document.getElementById('expiryPreview').textContent = this.value || 'MM/YY'"/>
                <label for="expiry" className=" card-label absolute left-4 top-3 text-gray-500 transition-all duration-200">Expiry Date</label>
            </div>
            <div className="relative">
                <input type="password" id="cvv" className="card-input block w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none placeholder-transparent" placeholder="CVV" maxlength="3" required/>
                <label for="cvv" className="card-label absolute left-4 top-3 text-gray-500 transition-all duration-200">CVV</label>
            </div>
        </div>

        <button type="submit" className="group relative w-full flex justify-center py-3 px-4 border border-transparent rounded-lg text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 transition-all duration-200">
            <span className="absolute left-0 inset-y-0 flex items-center pl-3">
                <svg className="h-5 w-5 text-indigo-300 group-hover:text-indigo-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12 15v2m-6 4h12a2 2 0 002-2v-6a2 2 0 00-2-2H6a2 2 0 00-2 2v6a2 2 0 002 2zm10-10V7a4 4 0 00-8 0v4h8z"/>
                </svg>
            </span>
            Pay Now
        </button>
    </form>
</div>
    )
}

export default Payment
